import React, { useEffect, useState } from 'react';
import { getWisata } from '../../api';
import BackButton from '../';
import { useNavigate } from 'react-router-dom';

const ManajemenWisata = () => {
    const [wisataList, setWisataList] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        getWisata().then(data => setWisataList(data));
    }, []);

    return (
        <div className="admin-container">
            <BackButton />
            <h2>Manajemen Wisata</h2>
            <table className="admin-table">
                <thead>
                    <tr>
                        <th>No</th>
                        <th>Nama Wisata</th>
                        <th>Aksi</th>
                    </tr>
                </thead>
                <tbody>
                    {wisataList.map((wisata, index) => (
                        <tr key={wisata.id}>
                            <td>{index + 1}</td>
                            <td>{wisata.nama}</td>
                            <td>
                                <button onClick={() => navigate(`/admin/edit-wisata/${wisata.id}`)}>Edit</button>
                                {/* Tombol hapus bisa ditambahkan jika perlu */}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManajemenWisata;
